<script>
    let students = new Set(["Kartik", "Mithilesh", "Sagar", "Mehul", "Shruti", "Aayushi", "Krishna", "Bhoomi", "sagar"]);

    document.write("<hr>Set Values : <hr>");

    for(let tmp of students.values()){
        document.write(" "+tmp);
    }

    document.write("<hr>Set Keys : <hr>");

    for(let tmp of students.keys()){
        document.write(" "+tmp);
    }

    document.write("<hr>Set Entries : <hr>");

    for(let tmp of students.entries()){
        document.write(" "+tmp);
    }
</script>
